import React from "react";
import { NavLink } from "react-router-dom";

const Nav = () =>{
    return (
        <React.Fragment>

        <div>
            
             <NavLink to='/' exact activeClassName='active'> About Us </NavLink>
             <NavLink to='/contact' autoClassName='active'> Contact Us </NavLink>
        
        </div>

        </React.Fragment>
    )
}

export default Nav;
